what is the output when the following program is run?
class A {public int x;}
public class Main
{static void fun(A t) {t.x += 2;}
public static void main(String args[])
{A t = new A();
t.x = 99;
System.out.print(t.x + " ");
t.x++;
System.out.print(t.x + " ");
fun(t);
System.out.print(t.x);
}
}

A. 98 99 101
B. 99 99 101
C. 99 100 100
D. 99 100 101
E. 99 100 102

